    false,nt"url": null,nt"notes": "This report presents in tabular form a
    complete listing of faunal and minor floral elements, along with their identification
    as known to date, for all fossils collected by field party members of the Alaska
    Division of Geological & Geophysical Surveys (DGGS) during their 1997 and 1998 geological
    mapping effort in the Healy A-6 Quadrangle. In addition, all known U.S. Geological
    Survey fossil localities that could be located from previously published maps are
    also shown on the fossil locality map and listed in the fossil register.",nt"license_title":
